import React, { Component } from 'react';
import './App.css';

import Todos from './components/Todos';

class App extends Component {

  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: False
      },
      {
        id: 2,
        title: 'Dinner with friends!',
        completed: False
      },
      {
        id: 3,
        title: 'Meeting with teammates!',
        completed: False
      }
    ]
  }

  render() {
    console.log(this.state.todos);
    return (
      <div className="App">
        <Todos />
      </div>
    );
  }
}

export default App;
